import { Service } from "./Service"

export const ServicesList = ({ services }) => {
    log
    return services.length > 0 ? (<ul>
        {services.map(service => <li key={services.id}><Service service={service} /></li>)}
    </ul>
    ) : <p>There are not services created</p>
}
